INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(1, 'HTML and CSS Tutorials - 2022', 'If you’re new to web development, HTML is the perfect place to start. It’s the foundation of all websites and is both simple and powerful. This collection of HTML tutorials will guide you step-by-step through the basics, helping you build and structure your first webpages. Whether you’re learning for personal projects or professional development, these tutorials are designed to be beginner-friendly and up-to-date.', 1, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbnSe1qUNMG7AbPmjIG54u88', 4, 72, 100, 'Frontend Developer', NULL, 5700000, 'HTML/CSS,UI/UX design,server-client flow ', 'Nothing', 500),
(2, 'Javascript Tutorial', 'A collection of JavaScript tutorials for beginers.', 1, 1, 'data:image/png;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbleDe3_ZA8h3AO2rXar-q2V', 2, 48, 500, 'Frontend Developer', NULL, 18000000, 'Javascript,Many wonderfull project,connect database', 'Knowing HTML/CSS, database', 2);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(3, 'React Native Web', 'Learn to build cross-platform web apps using React Native Web, sharing a single codebase for both mobile and web. We’ll cover setup, responsive design, and using React Native components for the web. Let’s get started!', 2, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAblh4QvUtzEq4qgs_bnvBrw2', 3, 14, 50, 'FullStack Developer', NULL, 51000, 'ReactNative dev,Serverside,Mobile/web deverloper', 'Knowing HTML/CSS/javascript,ReactJS,OS,Docker', 32);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(4, 'Laravel in 4 hours', 'In this fast-paced course, you’ll learn the essentials of Laravel, a powerful PHP framework for building modern web applications. Over the next 4 hours, we’ll cover everything from setting up your environment to routing, controllers, views, and database interactions. By the end, you\'ll be ready to build your own Laravel applications quickly and efficiently.', 1, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbkoMsX4hgwxbJZW4aB0cbaB', 4, 16, 5, 'Frontend Developer', NULL, 3900000, 'Laravel,PHP,Deploy,Nginx', 'Knowing HTML/CSS/javascript/PHP', 200);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(5, 'Python Basics with Sam', 'If you’ve never written a single line of code, don’t worry—this guide will take you through Python from the very beginning, step by step. You’ll learn how to set up your environment, write basic scripts, and progress to building real-world applications. By the end, you’ll not only understand Python fundamentals but also be ready to tackle more advanced concepts.', 3, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbkmRvnFmOd4KhDdlK1oIq23', 4.2, 20, 45, 'Language Programming', NULL, 387000, 'How python work,Data strutural(String - Array - List - Os),Shopping App', 'None require', 500);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(6, 'Java Tutorials', 'This guide helps you master Java basics and gradually advance to integrating web services into your Java applications.', 1, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbnRT_hue-3zyiuIYj0OlpyG', 3.2, 40, 20, 'Language Programming', NULL, 6500000, 'Java high concept,java spring boost,data structural,Android Development for begginers', 'C++,Algorithm', 1000);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(7, 'Data Structures and Algorithms', 'This guide focuses on learning the core concepts of data structures and algorithms (DSA) with JavaScript in a simple, digestible way. By the end, you’ll understand key DSA concepts and how to implement them in JavaScript.', 2, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbkso-IbgiiP48n-O-JQA9PJ', 4.8, 4, 15, 'Algorithm and Data Strutural', NULL, 1000000, 'Algorithm and Data Strutural,Javascript,implement algorithm to the real world', 'Mathematics,C++ intermediate,English', 300);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(8, 'C / C++ in 4 hours', 'In just 4 hours, gain a solid foundation in C/C++ programming. By the end, you’ll be able to write basic programs, understand key concepts, and leverage this knowledge for deeper exploration of the language', 2, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbmUE5IqyfGYEYjrZBYzaT4m', 3.7, 32, 10, 'Language Programming', NULL, 16000000, 'C++ highconcept,Data structurl and algoreithm', 'Nothing', 2389);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(9, 'CS50\'s Introduction to Game Development', 'Lua is a lightweight, fast, and flexible scripting language widely used in the gaming industry. From scripting in AAA games to indie projects, Lua powers game engines like LOVE2D, Defold, and Roblox Studio. This guide will introduce you to Lua and how to use it for game development, even if you\'re just starting.', 2, 1, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLWKjhJtqVAbluXJKKbCIb4xd7fcRkpzoz', 4.9, 22, 39, 'Game Dev', NULL, 1000000, 'Game Logicstic,Data Structural,Lua programe', 'Python,C++,Mathematical,Algorithms', 900);
INSERT INTO `Courses` (`course_id`, `course_name`, `course_intro`, `lecturer_id`, `host_id`, `image`, `url_list`, `rate`, `hours`, `cost`, `field`, `learners`, `views`, `gained`, `required`, `rating_count`) VALUES
(10, 'Machine Learning Specialization', 'The Machine Learning Specialization is designed for anyone eager to understand the fundamentals of machine learning and leverage these skills to solve real-world problems. Whether you\'re a beginner or an experienced programmer, this guide will provide you with the resources, structure, and practical applications to master machine learning.', 4, 4, 'data:image/jpeg;base64,', 'https://www.youtube.com/playlist?list=PLkDaE6sCZn6FNC6YRfRQc_FbeQrF8BwGI', 4.9, 5, 50, 'Machine Learning,Mathematical', NULL, 420000, 'Machine Learning,Mathematical,Python Programming,Oriented Object Programming', 'Python,C++,Mathematical,Algorithms', 1000);

